import React, { Component } from 'react';
import Navibar from "../Coponent/Navibar";
import { Link } from 'react-router-dom';
import { FiUser } from "react-icons/fi";
import { FiEdit } from "react-icons/fi";
import { FiHome } from "react-icons/fi";
import Axios from 'axios';

export default class Myaccount extends Component {
    constructor(){
        super();
        this.state = {
            info:[]
        }
        this.getData=this.getData.bind(this);
    }
    async getData(){
        var url="http://127.0.0.1:8080/v2/user/info?uid="
        url+=this.props.uid.email
        Axios.get(url)
            .then(res=>{
                console.log("res:",res.data);
                this.props.handleuser(res.data)
            });   
    }
    render() {
        return (
            <div className="room">
                <Navibar loggedinstatus={this.props.loggedinstatus}/>
                <div className="leftnav">
                    <FiUser/>
                    <div>
                        <Link to={"./hostprofile"} onClick={()=> {this.getData()}} info={this.state.info}><b>Your Profile</b></Link>
                    </div> 
                    <h4>Check your personal details and upload your head image</h4>
                </div>
                <div className="leftnav">
                    <FiHome />
                    <div>
                        <Link to={"./host"}><b>Upload properties</b></Link>
                    </div>
                    <h4>Uplpoad your properties to our website</h4>
                </div>
                <div className="leftnav">
                    <FiEdit />
                    <div>
                        <Link to={"./property"}><b>Manage properties</b></Link>
                    </div>
                    <h4>Edit or delete your properties</h4>
                </div>


            </div>
        );
    }
}
